Setting up Terraform to manage the DNS records of a new domain name involves a few steps. First of all you need to decide the identifier used inside Terraform for that domain. By convention, the identifier is the domain name itself with . and - replaced with _. For example rust-lang.org becomes rust_lang_org. Then you can create a file in terraform/services/dns named after the domain name, ending in .tf, with this content (take care of replacing the placeholders): module "<IDENTIFIER>" { source = "./domain" domain = "<DOMAIN-NAME>" comment = "<COMMENT-FOR-THE-DOMAIN>" ttl = 300
} Finally you need to output the ID of the Route53 zone, allowing other parts of our Terraform configuration to add records. Add this snippet to terraform/services/dns/outputs.tf : # ... output "zone_<IDENTIFIER>" { value = module.<IDENTIFIER>.zone_id
} Once you're done you can apply the changes with: terraform init
terraform apply

