Our Terraform configuration supports creating redirects from an arbitrary number of subdomains we control to an URL. Redirects are created with these pieces of infrastructure: A S3 bucket for each set of redirects, named rust-http-redirect-<HASH>. The bucket has website hosting enabled, configured to redirect all the incoming requests to the chosen URL. This allows implementing redirects without an underlying server. An ACM certificate (plus the DNS records to validate it) for each set of redirects, with all the sources as alternate names. This is used to enable HTTPS redirects. A CloudFront distribution for each set of redirects to support HTTPS requests, using the previously generated ACM certificate and forwarding requests to the S3 bucket. Route53 records for each redirect in the related zones: CNAMEs for subdomains, and ALIASes for apex domains. All the redirects are defined in terraform/redirects.tf , with a module for each destination URL. Either create a new module if you need to redirect to a new URL, or add a new subdomain to an existing module. See an example module here (take care of replacing the placeholders): module "redirect_<IDENTIFIER>" { source = "./modules/subdomain-redirect" providers = { aws = "aws" aws.east1 = "aws.east1" } to = "<DESTINATION-URL>" from = { "<SUBDOMAIN-1>" = module.dns.zone_<DOMAIN-1-IDENTIFIER>, "<SUBDOMAIN-2>" = module.dns.zone_<DOMAIN-2-IDENTIFIER>, }
} Once you made all the changes you can apply the configuration with: terraform init
terraform apply Note that each change is going to take around 15 minutes to deploy, as CloudFront distribution changes are really slow to propagate. Also, it's normal to see a bunch of resources being recreated when a domain is added or removed from an existing redirect, as the ACM certificate will need to be regenerated.

